import { LoginContainer, Title, AuthContainer, Login, Help, Signup } from "./Utility";
function LoginPage({Setauth}) {
  return (
    <div style={{minWidth:"1080px"}}>
      <LoginContainer>
        <Title>PlanR</Title>
        <AuthContainer>
            <Login>Login</Login>
            <Signup>Signup</Signup>
            <Help>Help</Help>
        </AuthContainer>
      </LoginContainer>
    </div>
  );
}

export default LoginPage;
